import React from 'react';

export default function Content() {
  return ( 
  <div className = "container">
     <form>
        <h3 className="login-text" >Type Your Notes Here !!</h3>
        <label for="title" className = "login-label1">Title</label>
        <input type="text" id="title" name="title"></input>
        <label for="subject" className = "login-label1">Subject</label>
        <textarea id="subject" name="subject" style={{height:"150px"}}></textarea>
        <input type="submit" value="Submit" className="login-btn"></input>
     </form>
  </div>);
}
